const Blog = ({blog}) =>{
  return(
    <div>
      <p>{blog.title} {blog.author}</p>
      <p>{blog.url}</p>
      <p>{blog.likes}</p>
      <p>{blog.user.user}</p>
    </div>
  )
}

export default Blog
